Este poema fue escrito por Antonio Fernández Grilo (1845-1906), poeta español del siglo XIX. Fue un poeta cordobés que alcanzó cierta fama en su época, especialmente en los círculos literarios de Madrid, aunque actualmente es menos conocido que otros poetas de su tiempo.
